import React from 'react';
import "./style.css"

function Body() {
    return (
        <div>
            <img src={require("./images/pikachu.png")} height="200px" width="200px" alt="An adorable little Pikachu"></img>
            <img src={require("./images/charmander.png")} height="200px" width="200px" alt="An adorable little Charmander"></img>
            <img src={require("./images/squirtle.jpg")} height="200px" width="200px" alt="An adorable little Squirtle"></img>
        </div>
    )
}
  
export default Body;
